import React from "react";
import {
  Dimension,
  StyleSheet,
  TouchableOpacity,
  View,
  ScrollView,
  Text,
} from "react-native";


  const Option = (props) => {
 
  return (
    <TouchableOpacity
      onPress={() => props.changeVisbility}
      style={styles.container}
    >
          <Text style={styles.buttonOpen}>Hide Modal</Text>
    </TouchableOpacity>
  );
};
const styles = StyleSheet.create({
  container: {
    flex: 1,
   
    justifyContent: "center",
  },
  modal: {
    backgroundColor: "white",
    borderRadius: 10,
  },
  option: {
    alignItems: "flex-start",
  },
  text: {
    margin: 20,
    fontWeight: "bold",
    fontSize: 20,
  },
  buttonOpen: {
    backgroundColor: "#F194FF",
  },
});
export default Option;
